def sum_list(numbers: list[int]) -> int:
    """Sum a list of numbers using the add function.
    
    Args:
        numbers: List of integers to sum.
        
    Returns:
        Sum of all numbers.
    """
    result = 0
    for num in numbers:
        result = add(result, num)
    return result
